class TreeNode {
  constructor(val) {
    this.val = val;
    this.left = null;
    this.right = null;
  }

}
function buildTree(preorder, inorder) {
  if (preorder.length == 0) return null;
  let pos = 0;
  while (inorder[pos] != preorder[0]) ++pos;
  let lpre = [], lin = [], rpre = [], rin = [];
  for (let i = 0; i < pos; i++) {
    lpre.push(preorder[i + 1]);
    lin.push(inorder[i]);
  }
  for (let i = pos + 1; i < inorder.length; i++) {
    rpre.push(preorder[i]);
    rin.push(inorder[i]);
  }
  // 分别遍历左树与右树
  let root = new TreeNode(preorder[0]);
  root.left = buildTree(lpre, lin);
  root.right = buildTree(rpre, rin);
  return root;
}

let node = buildTree(preorder, inorder);
function postorder(node, ans) {
  if (!node) return;
  postorder(node.left, ans);
  postorder(node.right, ans);
  ans.push(node.val);
}
let ans = []
postorder(node, ans);
let sum = 0;
ans.forEach((e, i) => {
  sum += e * (i + 1);
})
console.log(sum);